import React, { Component } from 'react'
import {Nav} from 'react-bootstrap';
import  Logo from '../imgs/Logo.png';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import './header.css'


export default class Header extends Component {
    constructor(props){
        super(props)
        this.state = {
            display: false, 
            autoplay: false,
        }
    }

render(){   
    return(          
            <div className='header'>
                <Row style={{overflowX:'hidden'}}>
                    <Col md = {3}>
                        <a><img src={Logo} alt='logo' style={{marginLeft:'-35%',width:'40%', height:'100%'}} href='/home'/></a>
                    </Col>
                    <Col md={6}></Col>
                    <Col md = {1} style={{marginTop:'30px'}}>  
                        <Nav.Link href='/work' className='nav_link'>WORK</Nav.Link>
                    </Col>
                    <Col md = {1} style={{marginTop:'30px'}}>
                        <Nav.Link href='/play' className='nav_link'>PLAY</Nav.Link>
                    </Col>
                </Row>  
            </div>
    )
}
}
